import React from 'react';
import ReactDOM from 'react-dom/client';

import './index.css';

import App from './App';
const page = (
  <h1> Testing</h1>
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
ReactDOM.render(page,document.getElementById("root"));
